import java.lang.*;
import gpdraw.*;
import java.awt.geom.Point2D;
import java.awt.Point;

public class P3_Jang_Jeremy_MyFractal{
    SketchPad pad;
    DrawingTool pen;
    
    public static void main(String[] args) {
        P3_Jang_Jeremy_MyFractal tSquareFractal = new P3_Jang_Jeremy_MyFractal();
        tSquareFractal.drawTSquare(5, 5, 200);
    }
    

    public P3_Jang_Jeremy_MyFractal(){
        pad = new SketchPad(800, 800, 500);
        pen = new DrawingTool(pad);
    }

    
    public void drawTSquare(int level, int totalLevel, double length){
                
        if (level < 1){
            pen.up();
            pen.move(0,0);
            pen.down();
            length = length * Math.pow(2, totalLevel);
            
            pen.fillRect(length, length);
        } 
        else {
            		
			// it's already working from here on
 			double x = pen.getXPos();
 			double y = pen.getYPos();
			pen.up();
			pen.move(x+length/2, y+length/2);
			pen.down();
			pen.fillRect(length/2, length/2);
			drawTSquare(level-1, totalLevel, length/2);
			
			pen.up();
			pen.move(x-length/2, y+length/2);
			pen.down();
			pen.fillRect(length/2, length/2);
			drawTSquare(level-1, totalLevel, length/2);
			
			pen.up();
			pen.move(x-length/2, y-length/2);
			pen.down();
			pen.fillRect(length/2, length/2);
			drawTSquare(level-1, totalLevel, length/2);
			
			pen.up();
			pen.move(x+length/2, y-length/2);
			pen.down();
			pen.fillRect(length/2, length/2);
			drawTSquare(level-1, totalLevel, length/2);
  
        } 
    }
}

