import gpdraw.*;
public class P2_Ratnam_Roger_MyFractal{
    public static void main (String[]args){
        P2_Ratnam_Roger_Fractal obj = new P2_Ratnam_Roger_Fractal();
        obj.draw(2,50);
    }
}
class P2_Ratnam_Roger_Fractal{
    DrawingTool pen;
    SketchPad paper;
    public P2_Ratnam_Roger_Fractal(){
        paper = new SketchPad(1000,1000);
        pen = new DrawingTool(paper);
        
    }
    public double getX(){
        return pen.getXPos();
    }
    public double getY(){
        return pen.getYPos();
    }
    public void draw(int level, double width){
    if (level==0){
        pen.fillRect(width,width);
        
    }
    else{
        draw(level-1,width);
        pen.move(getX()+width/2,getY()+width/2);
        draw(level-1,width/2);
        pen.move(getX(),getY()-width);
        draw(level-1, width/2);
        pen.move(getX()-width,getY());
        draw(level-1,width/2);
        pen.move(getX(),getY()+width);
        draw(level-1,width/2);
    }
    }
}

import gpdraw.*;
 class P6_Murugesan_Avaneesh_tSquareFractal {
     DrawingTool pen = new DrawingTool(new SketchPad(1000,1000));
    public void fillSquare(double x, double y,double length ){
        pen.up();
        pen.move(x,y);
        pen.down();
        pen.fillRect(length,length);
        
    }
    public void drawFractal(int level, double x, double y, double length) {
        if (level == 0){
        fillSquare(x,y,length);

    }   else{

        
        fillSquare(x,y,length);
        drawFractal(level-1,x-length/2,y-length/2,length/2);  
        drawFractal(level-1,x-length/2,y+length/2,length/2);    
        drawFractal(level-1,x+length/2,y-length/2,length/2);   
        drawFractal(level-1,x+length/2,y+length/2,length/2);  
    }
    }
}

